black moss.description:
Black moss may refer to:Bryoria fremontii, a lichen eaten by First Peoples in North America;
Fat choy, a terrestrial cyanobacteria eaten in Chinese cuisine;
Spanish moss, a flowering plant, particularly after it has been dried for use as stuffing and decoration;
Numerous species of dark-coloured moss (Bryophyta), possibly species of the genera Grimmia, Andreaea, Syntrichia, or Cinclidotus;
Black Moss Press, a Canadian literary press founded in 1969.
A geographical area of moorland between Diggle and Meltham in West Yorkshire

bock beer.description:
Bock is a strong beer of German origin, brewed as a lager when made with only barley malt, and brewed as an ale when wheat malt is added. In addition to the main style of bock, several substyles exist, including:Maibock, a paler, more hopped version generally made for consumption at spring festivals. Due to its lighter color, it is also referred to as helles bock, heller bock; from German helle, bright, light in color;
Doppelbock, a stronger and maltier version;
Weizenbock, a version using 40–60% wheat, and
Eisbock, a much stronger version made by partially freezing the beer and removing the ice that forms.
